import { useEffect, useState } from "react";

const contact =
[
{
  id: 7,
  name: "Cat",
  username: "Cat123",
  email: "email.com",
  address:
  {
    street: "street",
    suite: "suite",
    city: "howemouth",
    zipcode: "566",
  },
  geo:
  {
    lat: "",
    lng: "",
  },
  phone: "phone",
  website: "website",
  company: {
    name: "name",
    catchPhrase: "catch",
    bs: "gen"
  },
},
];

const ContactCard = (props) =>
{
    const
    {
        name,
        username,
        email,
        address,
        geo,
        phone,
        website,
        company
    } = props;

    return (
        <div>
            {name}, {username}
        </div>
    )
}

export const Contacts = () =>
{
    const [contacts, setContacts] = useState(contact);
    const requestURL = "https://jsonplaceholder.typicode.com/users";

    useEffect(() =>
    {
        (async() => {
            const data = await fetch(requestURL).then((data) => console.log(data));
            // console.log(data.body);
        })();
    }, []);

    return (
    <div className="container--home">

        {contacts.length === 0 && <p> Loading... </p> }
        { contacts.length != 0 && contacts.map((aContact) =>
        {
            return <ContactCard {...aContact} />
        })}
    </div>
    );
}
